                    <div className="col-6 tilepart1">

</div>
<div className="col-6 tilepart2">

</div>

                    </div>
                </div>
            </div>
        )
    }
    componentDidMount(){
        fetch(mealtypeurl,{method:'GET'}).then((res) => res.json()).then((data) => {
            this.setState({mealtype:data})
        })
    }

}

